import { Component, OnInit } from '@angular/core';
import { BokingService } from '../boking.service';
import { ActivatedRoute, Router } from '@angular/router';
import { Booking } from '../booking';
import { Show } from 'src/app/show/show';

@Component({
  selector: 'app-detail-view-booking',
  templateUrl: './detail-view-booking.component.html',
  styleUrls: ['./detail-view-booking.component.css'],
})

/**
 * @author Jyothi
 * @Description It is to display the booking summary of the Customer.
 */
export class DetailViewBookingComponent implements OnInit {
  booking!: Booking;
  bookingId!: number;
  show: Show;
  constructor(
    private actRouter: ActivatedRoute,
    private router: Router,
    private bService: BokingService
  ) {}

  ngOnInit(): void {
    this.bookingId = this.actRouter.snapshot.params['bookingId'];
    this.bService.getTotalCost(this.bookingId);
    this.bService.getBookingById(this.bookingId).subscribe((data: Booking) => {
      this.booking = data;
      console.log(this.booking.show.showId);
    });
  }
}
<section id="detailMovie">
  <div class="container">
    <div class="section-title">
      <h1><i class="icofont icofont-film"></i>Booking Summary</h1>
    </div>
    <hr />
    <div class="details">
      <div class="row flexbox-center">
        <div class="col-lg-7">
          <div class="movieDetails-content">
            <h2>Booking Details</h2>
            <br />
            <ul>
              <li>
                <div class="movieDetail-left">Movie:</div>
                <div class="movieDetail-right">
                  <a href="#">{{ booking.show.movie.movieName }}</a>
                </div>
              </li>
              <li>
                <div class="movieDetail-left">Show Date:</div>
                <div class="movieDetail-right">{{ booking.show.showDate }}</div>
              </li>
              <li>
                <div class="movieDetail-left">Show Start Time:</div>
                <div class="movieDetail-right">
                  {{ booking.show.showStartTime.show.showStartTime }}
                </div>
              </li>
              <li>
                <div class="movieDetail-left">Transaction Mode:</div>
                <div class="movieDetail-right">
                  {{ booking.transactionMode }}
                </div>
              </li>
              <li>
                <div class="movieDetail-left">Transaction Status:</div>
                <div class="movieDetail-right">
                  {{ booking.transactionStatus }}
                </div>
              </li>
              <li>
                <div class="movieDetail-left">Total Cost:</div>
                <div class="movieDetail-right">
                  {{ booking.totalCost }}
                </div>
              </li>
            </ul>
          </div>
        </div>
      </div>
      <a [routerLink]="['/movie']" class="theme-btn"
        ><i class="icofont-ticket"></i>Back to MOVIES</a
      >
    </div>
  </div>
</section>
